import React from "react";
const edus = [
  { title: "Flatiron School" },
  { title: "Montclair State University" },
  { title: "Kean University" },
];

function Education() {
  return (
    <div id="education-section" className="section">
      <h4>Education</h4>
      <ul id="ed-list">
        <li>Flatiron</li>
        <li>Montclair</li>
        <li>Kean University</li>
      </ul>
    </div>
  );
}

export default Education;
